import * as React from 'react';

const App = () => {
  const greeting = 'Welcome to React';

  const [isShow, setShow] = React.useState(true);

  const handleToggle = () => {
    setShow(!isShow);
  };

  return (
    <div>
      <button onClick={handleToggle} type="button">
        Toggle
      </button>

      {isShow ? <Welcome text={greeting} /> : null}
    </div>
  );
};

const Welcome = ({ text }) => {
  return <h1>{text}</h1>;
};
function football(){
    const shoot =()=>{
        alert('Great');
    }
    return(
        <button onClick={shoot}>Take The Shot</button>
    );
}
// export default football;
// export default App;



///Map Method For displaying all array
function Car(props){
    return<li>I am {props.brand}</li>
}
function Garage(){
    const cars = ['Ford','BMW','Audi'];
    //Key use
    const car = [
        {id:1,brand: 'Ford'},
        {id:2,brand: 'Ford'},
        {id:3,brand: 'Ford'},
        {id:4,brand: 'Ford'}
    ];
    return(
        <>
        <h1>Who lives</h1>
        <ul>
            {cars.map((cars) =>
            // <Car
            // brand={ cars }
            // /> 
            <Car
            key={car.id}
            brand={car.brand}
            />
            )}
        </ul>
        </>
    )
}
export default Garage;
